import React from 'react'
import classes from './Question.module.css'

const Question = () => {
    return (
        <div className={classes.all}>
            お問い合わせ
            以下のフォームから回答してください。
            https://docs.google.com/forms/d/e/1FAIpQLSfufDZ65-WX590zRFBDBF41EH0AD2Hk4LqPq_wbex7FAfepBA/viewform
        </div>
    )
}

export default Question
